// src/pages/HomePage.js
import React from 'react';
import './global.css';

const HomePage = () => {
  return (
    <div className="container">
      <section className="banner">
        <h1>Welcome to Dubai Project</h1>
        <p>Your gateway to unparalleled services in Dubai</p>
      </section>

      <section className="section light">
        <div className="content">
          <h2>Our Services</h2>
          <p>Explore our wide range of services designed to cater to your every need.</p>
          <img src="/src/assets/services.jpg" alt="Our Services" />
        </div>
      </section>
    </div>
  );
};

export default HomePage;
